import React from 'react';
import { useNavigate } from 'react-router-dom';
import './MainPage.css';
import monsterImage from './assets/images/legendtest.png'; // 이미지 import

function MainPage() {
  const navigate = useNavigate();
  const money = 100; // 예시로 현재 돈 값을 설정

  const handleLogout = () => {
    navigate('/');
  };

  return (
    <div className="main-container">
      <div className="sidebar">
        <button className="menu-button">상점</button>
        <button className="menu-button">내카드</button>
      </div>

      <div className="main-content">
        <div className="top-bar">
          <span className="money">현재 돈: {money}원</span>
          <button className="logout-button" onClick={handleLogout}>로그아웃</button>
        </div>

        <div className="monster-card">
          <img src={monsterImage} alt="대표 몬스터 카드" className="monster-image" />
        </div>

        <div className="bottom-buttons">
          <button className="code-input">방 코드 입력</button>
          <button className="create-room">방만들기</button>
        </div>
      </div>
    </div>
  );
}

export default MainPage;
